llm_output:
function transfer(address recipient, uint256 amount) public {
    require(recipient != address(0), "Transfer to the zero address");
    require(amount > 0, "Transfer amount must be greater than zero");
    require(msg.sender == owner, "Caller is not the owner");
    require(balanceOf(msg.sender) >= amount, "Transfer amount exceeds balance");

    if (transferDelayEnabled) {
        require(block.number > lastTransferBlock[tx.origin], "Transfer delay enabled. Only one purchase per block allowed.");
        lastTransferBlock[tx.origin] = block.number;
    }

    uint256 taxAmount = (amount * taxRate) / 100;
    uint256 transferAmount = amount - taxAmount;

    require(transferAmount > 0, "Transfer amount must be greater than zero after tax");

    _balances[msg.sender] -= amount;
    _balances[recipient] += transferAmount;
    _balances[address(this)] += taxAmount;

    emit Transfer(msg.sender, recipient, transferAmount);
    emit Transfer(msg.sender, address(this), taxAmount);

    if (swapEnabled && !inSwap && msg.sender != uniswapV2Pair) {
        uint256 contractTokenBalance = balanceOf(address(this));
        if (contractTokenBalance >= _taxSwapThreshold) {
            if (contractTokenBalance > _maxTaxSwap) {
                contractTokenBalance = _maxTaxSwap;
            }
            swapTokensForEth(contractTokenBalance);
        }
    }
}

function swapTokensForEth(uint256 tokenAmount) private {
    // Generate the uniswap pair path of token -> weth
    address[] memory path = new address[](2);
    path[0] = address(this);
    path[1] = uniswapV2Router.WETH();

    _approve(address(this), address(uniswapV2Router), tokenAmount);

    // Make the swap
    uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
        tokenAmount,
        0, // Accept any amount of ETH
        path,
        address(this),
        block.timestamp
    );
}

